import React,{Component} from 'react';
import './contact.css';
import 'tachyons';
import FormInput from './FormInput.js';
import CustomButton from './CustomButton.js';
import { FaGithub } from "react-icons/fa";


const initialState = {
	email: '',
	name: '',
  message:''
}

class Contact extends Component {
  constructor(props) {
    super(props);
    this.state = initialState;
  }
  handleSubmit = (event) => {
		event.preventDefault();
		this.setState({email: '', password: ''});
	}

	handleChange = (event) => {
		const {value, name} = event.target;
		this.setState({[name]: value});
	}
  render(){

    return (
      <div id="inner" >
      <div className="form">
      <h1 className="mb3">Contact Us</h1>
  <div className="bb bw2 center mt3" style={{width:'35vw'}} ></div>
      				<form onSubmit={this.handleSubmit}>
              <FormInput
              label="Name"
              name="name"
              type="text"
              value={this.state.name}
              handleChange={this.handleChange}
              required
              />
      					<FormInput
      					label="Email"
      					name="email"
      					type="email"
      					value={this.state.email}
      					handleChange={this.handleChange}
      					required
      					/>
      					<FormInput
      					label='Message'
      					name="message"
      					type="text"
      					value={this.state.message}
      					handleChange={this.handleChange}
      					required
      					/>
      					<CustomButton type="submit">Contact Us</CustomButton>
      				</form>
      </div>
      <div>
      <h2>Useful links
      </h2>
      </div>
      <footer className="footer mt6">developed by debugged.exe</footer>
      <footer  className="footer">   software engineers</footer>
      </div>
    );
  }
}

export default Contact;
